ALTER DATABASE [] SET TRUSTWORTHY ON
go
sp_configure 'clr enabled', 1
go
reconfigure
go
EXEC sp_changedbowner 'sa' 
go
create schema comdiv
go

create table comdiv.prop (id int identity(1,1) primary key, code nvarchar(255) unique, value nvarchar(max))
go

create function comdiv.get_prop_value (@code nvarchar(255)) returns nvarchar(max) as begin
	return (select top 1 value from comdiv.prop where code = @code)
end
go
create proc comdiv.set_prop_value @code nvarchar(255),@value nvarchar(max) as begin
	if(select top 1 id from comdiv.prop where code = @code) is null begin
		insert comdiv.prop (code,value) values (@code, @value)
	end else begin
		update comdiv.prop set value = @value where code = @code
	end
end

go

